def train():
    model = Ner_Model(bert_root,data_path,model_save_path,batch_size,max_len,lr,keep_prob)
    with tf.device('/gpu:0'):
        sess = tf.compat.v1.Session()
        writer = tf.summary.FileWriter('./tf_log/', sess.graph)
        # saver = tf.compat.v1.train.Saver()
        # saver = tf.train.Saver(defer_build=True)
        # saver.build()
        sess.run(tf.global_variables_initializer())
        data_loader = Data_loader(train_input, batch_size)
        print(data_loader.num_batches)
        for i in range(epochs):
            data_loader.shuff()
            for j in range(data_loader.num_batches):
                x_train, y_train = data_loader.next_batch(j)
                step, loss_, log = model.run_step(sess, x_train, y_train)
